import React from 'react';
import styles from './navbar.module.scss'
import { Icon } from '@iconify/react/dist/iconify.js';

function Navbar() {
  return (
    <header  className={styles.header}>
        <article>
            {/*searchbar*/}
        </article>
        <div>
            <Icon icon={"hugeicons:sunset"} />
        </div>
    </header>
  )
}

export default Navbar
